RETURNING mgl.zoom;

CREATE TRIGGER trigger_update_modified
BEFORE UPDATE ON map_group_locations
FOR EACH ROW
WHEN (OLD IS DISTINCT FROM NEW)
EXECUTE FUNCTION map_group_location_update_modified();
